import Login from "../pages/MainLogin";
import Detail from "../pages/MainDetail";
import Top from "../pages/MainTop";
import Vue from "vue";
import Router from "vue-router";

Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {
      path: "/",
      name: "Login",
      component: Login
    },
    {
      path: "/top",
      name: "Top",
      component: Top
    },
    {
      path: "/detail",
      name: "Detail",
      component: Detail
    }
  ]
});
